import React from 'react'

import { Provider } from 'react-redux'

import Beers from './Views/Beers';
import store from './app/store'

import 'semantic-ui-css/semantic.min.css'

function App() {

  return (
    <Provider store={store}>
      <Beers />
    </Provider>
  );
}

export default App;
